lit.com.tr/sites/kalekilit.com.tr/files/2020-06/dogal-ahsap-kaplamalar.jpg\"]','[]','2023-01-11 22:29:55',NULL,'ahsap-kaplamalar'),(367,'Kale Country Model',1,39,'Ahşabın sıcaklığını ve doğal dokusunu bir arada sunan Kale Country model çelik kapılar; geleneksel ve modern çizgilerden oluşan dört farklı tasarım alternatifiyle doğanın huzurunu hayatınıza getiriyor.Dürbün uygulanabilir .Taktak uygulanabilir.Renk kartelasında bulunan tüm ahşap ve lake renkler uygulanabilir.Cam çıtaları renk tonları farklılık gösterebilir.Lamine cam kullanılmaktadır. Doğal ahşap kaplamadan dolayı harelerde farklılık olabilir.Dış mekanlarda sundurma camekan vb konstruksiyon kullanılması önerilmektedir.','[\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/country-1000x1000.jpg\"]','[{\"name\":\"Teknik Bilgiler\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/kale-country-model_0.pdf\"},{\"name\":\"Aksesuarlar\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2021-02/kale-celik-kapi-aksesuarlar_7.pdf\"},{\"name\":\"Kilit Sistemleri\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2021-03/butik-kapi-kilit-sistemleri_2.pdf\"}]','2023-01-11 22:29:55',NULL,'kale-country-model'),(368,'Kale Twins',1,39,'Doğal ahşap görünümüyle modern çizgileri bir araya getiren Kale Twins model çelik kapılar, evlere sıcak ve samimi bir hava katıyor. Dürbün uygulanabilir.Renk kartelasında bulunan tüm ahşap renkler uygulanabilir.Taktak uygulanamaz.Doğal ahşaptan dolayı harelerde farklılık olabilir..','[\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/butik_twins_2019_0.jpg\"]','[{\"name\":\"Teknik Bilgiler\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/kale-twins.pdf\"},{\"name\":\"Aksesuarlar\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2021-02/kale-celik-kapi-aksesuarlar_1.pdf\"},{\"name\":\"Kilit Sistemleri\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2021-03/butik-kapi-kilit-sistemleri_16.pdf\"}]','2023-01-11 22:29:55',NULL,'kale-twins'),(369,'Kale Hare',1,39,'Doğal ve antik bir duruşa sahip Kale Hare model çelik kapılar, ham ağacın damarlarının ve dokusunun görüldüğü işçiliği ile göz alıcı bir görünüm sunuyor. Renk kartelasında bulunan tüm ahşap renkler uygulanabilir.Taktak uygulanamaz.Doğal ahşap kaplama, uygulamada farklılık göstermektedir. Hareler birbirini takip etmeyebilir.Taçlı pervaz opsiyoneldir.Dürbün konumu kanat boyuna göre farklılık göstermektedir.Kapı ölçülerine göre göbek sayısı değişebilir.','[\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/butik_hare_0.jpg\",\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/kale-hare-detay.jpg\"]','[{\"name\":\"Teknik Bilgiler\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/kale-hare_0.pdf\"},{\"name\":\"Aksesuarlar\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2021-02/kale-celik-kapi-aksesuarlar_5.pdf\"},{\"name\":\"Kilit Sistemleri\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2021-03/butik-kapi-kilit-sistemleri_10.pdf\"}]','2023-01-11 22:29:55',NULL,'kale-hare'),(370,'Yangın Kapısı',1,45,'Akredite edilmiş EFECTIS ERA Laboratuvarları’nda test edilmiş ve belgelenmiştir.Bütün kapılar üç contalı olup, dışta iki toz contası, içte bir ısı contasından oluşur.Isı contası 75 derecede genişleyerek duman ve sızdırmazlık sağlar.DC01 6112 kalite çelik sac levha kullanılmıştır.Kapı yüzeyi elektrostatik toz boya ile boyanmıştır.Isı genleşme boşlukları 5 mm\'dir.Ayarlanabilir kasaya sahiptir.Panik barlı ya da Kale Kilit’li, oynar kollu seçme imkânı bulunur.5 adetten fazla siparişlerde Ral kartelasından istenilen renk seçme imkânı bulunur.Standart renk: Ral 7035 / Ral 9010\'dır.Uluslararası akredite edilmiş laboratuvarlardan alınmış olan; E 120 sınıf yangın kapısı El2 90 sınıf yangın kapısı.','[\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-12/yangin-kapisi_2.jpg\"]','[{\"name\":\"Teknik Özellikler\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2021-03/yangin-kapisi-tr-guncel-teknik-ozellikler.pdf\"}]','2023-01-11 22:29:55',NULL,'yangin-kapisi'),(371,'Kale Antik Düz',1,39,'Misafirlerinizi yüzyıllar öncesinin zarafetini ve şıklığını yansıtan bir kapı ile karşılamak isterseniz, Kale Antik model kapılar tam size göre. Yılların eskitemediği karo modelinin, çapraz ve düz olarak uygulandığı iki farklı alternatif sunan Kale Antik çelik kapılardan evinize yakışanı seçin. Dürbün uygulanabilir.Renk kartelasında bulunan açık ayous uygulanabilir. Doğal ahşap kaplama uygulamada farklılık göstermektedir.Halka kol bu modelde taktak işlevi görmektedir. Ayrıca taktak uygulaması yapılamamaktadır.Dürbün,karo orta birleşim yerine denk getirilmektedir. Dürbün konumu kanat boyuna göre farklılık göstermektedir.Karo sayıları kapı ölçüsüne göre ayarlanmaktadır.Pervazlar masif olarak üretilmektedir.','[\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/butik_antik_duz_koyu.jpg\",\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/butik_antik_0.jpg\"]','[{\"name\":\"Teknik Bilgiler\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/kale-antik-duz.pdf\"},{\"name\":\"Aksesuarlar\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2021-02/kale-celik-kapi-aksesuarlar_11.pdf\"},{\"name\":\"Kilit Sistemleri\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2021-03/butik-kapi-kilit-sistemleri_6.pdf\"}]','2023-01-11 22:29:55',NULL,'kale-antik-duz'),(372,'Kale Unique',1,39,'Kale Unique model çelik kapılar, geleneksel karo motifini modernlikle buluşturan havalı ve şık bir tasarım sunuyor. Renk kartelasında bulunan tüm ahşap renkler uygulanabilir.Taktak uygulanamaz.Doğal ahşap kaplama, uygulamada farklılık göstermektedir. Çıtalarda renk farklılıkları olabilmektedir.Kapı kanadı maksimum 1000 mm en ölçüsünde üretilmektedir.','[\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/butik_unique_2019_0.jpg\",\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/kale-unique-detay.jpg\"]','[{\"name\":\"Teknik Bilgiler\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/kale-unique.pdf\"},{\"name\":\"Aksesuarlar\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2021-02/kale-celik-kapi-aksesuarlar.pdf\"},{\"name\":\"Kilit Sistemleri\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2021-03/butik-kapi-kilit-sistemleri_14.pdf\"}]','2023-01-11 22:29:55',NULL,'kale-unique'),(373,'Kale Antik Karo',1,39,'Misafirlerinizi yüzyıllar öncesinin zarafetini ve şıklığını yansıtan bir kapı ile karşılamak isterseniz, Kale Antik model çelik kapılar tam size göre. Yılların eskitemediği karo modelinin, çapraz ve düz olarak uygulandığı iki farklı alternatif sunan Kale Antik çelik kapılardan evinize yakışanı seçin. Dürbün uygulanabilir.Renk kartelasında bulunan açık ayous uygulanabilir. Doğal ahşap kaplama uygulamada farklılık göstermektedir. Halka kol bu modelde taktak işlevi görmektedir. Ayrıca taktak uygulaması yapılamamaktadır.Dürbün, dört karonun orta birleşim yerine denk getirilmektedir. Dürbün konumu kanat boyuna göre farklılık göstermektedir.Karo sayıları kapı ölçüsüne göre ayarlanmaktadır.Pervazlar masif olarak üretilmektedir','[\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/butik_antik-karo.jpg\",\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/kale-antik-karo-ayous.jpg\"]','[{\"name\":\"Teknik Bilgiler\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/kale-antik-karo.pdf\"},{\"name\":\"Aksesuarlar\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/antik-karo-aksesuarlar_0.pdf\"},{\"name\":\"Kilit Sistemleri\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2021-03/butik-kapi-kilit-sistemleri_4.pdf\"}]','2023-01-11 22:29:55',NULL,'kale-antik-karo'),(374,'K73',1,41,'Evinizde etkileyici ve klasik bir görünüm elde etmek istiyorsanız, zarafeti yansıtan Kale K73 model çelik kapıları pas geçemezsiniz. Dürbün uygulanabilir.Taktak uygulanabilir.Renk kartelasında bulunan antik kaplamalar hariç, tüm ahşap renkler ve RAL kodları uygulanabilir.','[\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/k73_0.jpg\"]','[{\"name\":\"Teknik Bilgiler\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/k73_0.pdf\"},{\"name\":\"Aksesuarlar\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2021-02/kale-celik-kapi-aksesuarlar_75.pdf\"},{\"name\":\"Kilit Sistemleri\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2021-03/butik-kapi-kilit-sistemleri_84.pdf\"}]','2023-01-11 22:29:55',NULL,'k73'),(375,'Kale Cam Kapı',1,39,'Tasarımında şehir hayatının dinamikliğini yansıtan Kale Cam çelik kapı modeli, evinde sade ve elegan şıklıktan hoşlananlar için biçilmiş kaftan.Dürbün uygulanabilir.Taktak uygulanamaz.Damlalık uygulanamaz.Standart cam renkleri RAL 9011, RAL 9005, RAL 7015, RAL7044, RAL9016 ve RAL9010\'dur.Diğer renk alternatifleri için lütfen satış temsilcinize başvurunuz.','[\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/butik_cam_panel_dis_0.jpg\"]','[{\"name\":\"Teknik Bilgiler\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/kale-cam-kapi.pdf\"},{\"name\":\"Aksesuarlar\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2021-02/kale-celik-kapi-aksesuarlar_9.pdf\"},{\"name\":\"Kilit Sistemleri\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2021-03/butik-kapi-kilit-sistemleri_0.pdf\"}]','2023-01-11 22:29:55',NULL,'kale-cam-kapi-39'),(376,'Kale Elegan',1,39,'Camın şıklığını ahşabın sıcaklığıyla buluşturan Kale Elegan çelik kapılar, evinize gösterişli bir hava katacak. Dürbün uygulanabilir.Standart cam renkleri RAL 9011, RAL 9005, RAL 7015, RAL7044, RAL9016 ve RAL9010\'dur.Diğer renk alternatifleri için lütfen satış temsilcisine başvurunuz.Taktak uygulanamaz.Doğal ahşap kaplama, uygulamada farklılık göstermektedir. Hareler birbirini takip etmeyebilir.Pervazlar orta panel gibi parlak malzemedendir.','[\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/proje_elegan_0.jpg\"]','[{\"name\":\"Teknik Bilgiler\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/kale-elegan.pdf\"},{\"name\":\"Aksesuarlar\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/aksesuarlar-tak-tak-uygulanamaz.pdf\"},{\"name\":\"Kilit Sistemleri\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2021-03/butik-kapi-kilit-sistemleri_8.pdf\"}]','2023-01-11 22:29:55',NULL,'kale-elegan-39'),(377,'Kameralı Dürbün',1,47,'     Kamera ve Zil özelliği\n     Evde yokum vb.. mesaj bırakma özelliği\n     Otomatik algılama ile alarm özelliği\n     Video ile mesaj bırakma\n     8GB hafıza kartı\n     Şarj edilebilir 1500mAh Lityum pil\n     Dürbün yeri delik ölçüleri: ø12 mm – 58 mm arasında uygulama\n     Kapı kalınlığı : 35 mm – 105 mm arasında uygulama','[\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-10/93b85168-fc59-4a8d-9bc4-c2b570d27b1c_0.jpg\"]','[{\"name\":\"Teknik Özellikler\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2021-02/kamerali-durbun-teknik-ozellikler.pdf\"}]','2023-01-11 22:29:55',NULL,'kamerali-durbun'),(378,'Gizli Menteşeli Kapı',1,47,NULL,'[\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/gizli-menteseli-kapi_0.jpg\",\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/gizli-menteseli-kapi2.jpg\"]','[{\"name\":\"Teknik Bilgiler\",\"link\":\"https://www.kalekilit.com.tr/sites/kalekilit.com.tr/files/2020-06/gizli-menteseli-kapi.pdf\"}]','2023-01-11 22:29:55',NULL,'gizli-menteseli-k